import PinInput from 'react-pin-input';
import Header from '../../components/Header';

const PIN = () => {
    return (
        <>
            <Header />
            <PinInput 
                length={6} 
                initialValue=""
                secret
                secretDelay={100} 
                onChange={(value, index) => {}} 
                type="numeric" 
                inputMode="number"
                style={{padding: '10px'}}  
                inputStyle={{borderColor: 'black'}}
                inputFocusStyle={{borderColor: 'blue'}}
                onComplete={(value, index) => {}}
                autoSelect={true}
                className="PIN"
            />
        </>
    );
}

export default PIN;
